import classes from "./Card.module.css"

const Card = (props) => {
  const [userInput, setUserInput]= useState("");
  const DataHandler=(event)=>{
    setUserInput(event);
  }
  return (
      <div className={`${classes.card} ${props.className}`}>{props.children}</div>
  );
};
export default Card;
